// src/components/Sidebar.js

import React from 'react';

const Sidebar = ({ addNode }) => {
  return (
    <div className="sidebar">
      <h2>Workflow Editor</h2>
      <button
        onClick={() => {
          const position = { x: Math.random() * 500, y: Math.random() * 500 }; // Random position
          console.log("Adding Task at position:", position); // Debug log
          addNode('task', position);
        }}
      >
        Add Task
      </button>
      <button
        onClick={() => {
          const position = { x: Math.random() * 500, y: Math.random() * 500 }; // Random position
          console.log("Adding Decision at position:", position); // Debug log
          addNode('decision', position);
        }}
      >
        Add Decision
      </button>
      <button
        onClick={() => {
          const position = { x: Math.random() * 500, y: Math.random() * 500 }; // Random position
          console.log("Adding End at position:", position); // Debug log
          addNode('end', position);
        }}
      >
        Add End
      </button>
    </div>
  );
};

export default Sidebar;
